import './Expenses.css';
import ExpenseItem from './ExpenseItem';

function Expenses(props) {
    return(
    <div className="expenses">
        <ExpenseItem title={props.items[0].title} amount={props.items[0].amount} date={items[0].date}/>
        <ExpenseItem title={props.items[1].title} amount={props.items[1].amount} date={items[1].date}/>
        <ExpenseItem title={props.items[2].title} amount={props.items[2].amount} date={items[2].date}/>

    </div>
    )

}

export default Expenses;
